import React from "react";
import "../components/style.css";
import { Link } from "react-router-dom";

const SideNav = () => {
  return (
    <div className="nav-container">
      <div className="brand-container">
        <img
          className="profile-logo"
          alt="brand-logo"
          src={require("../assets/edu logo 1.png")}
        />
        <div>
          <h2 className="brand-name">EI Management App</h2>
          <p className="brand-slogan">Manage your App in an easier way...</p>
        </div>
        </div>
        <div>
          <div className="menu-container">
            <Link className="menu-link">Home</Link>
            <Link className="menu-link">AllCourse</Link>
            <Link className="menu-link">Add Course</Link>
            <Link className="menu-link">Add Students</Link>
            <Link className="menu-link">All Students</Link>
            <Link>Collect Fee</Link>
            <Link>Payment History</Link>
          </div>
      </div>
    </div>
  );
};

export default SideNav;
